syntax = "proto3";

package Proto;


message GetAreaExplorePointRsp {
	enum GetAreaExplorePointRsp_CmdId {
		option allow_alias = true;
		None = 0;
		CmdId = 252;
		EnetChannelId = 0;
		EnetIsReliable = 1;
	}

	repeated uint32 AreaIdList = 13;
	int32 Retcode = 14;
	repeated uint32 ExplorePointList = 3;
}
